  false,\n\t\"url\": null,\n\t\"notes\": \"These data represent wildlife observations
  from surveys in 2004 and 2005 of 56 different Wildlife Areas and Ecological Reserves
  (units) managed by the California Department of Fish and Game (DFG) in the North
  Central Region (NCR). These wildlife species were observed by trained observers
  from the NCR's Resource Assessment Program (RAP) doing walking surveys through discrete
  habitat patches at the different DFG units. These wildlife species were observed
  from 374 different transects conducted between 14 July 2004 and 12 July 2005. There
  are 6,185 detections of 266 different taxa including amphibians, reptiles, birds,
  and mammals. Wildlife observation data are linked to the transect data with a common
  variable that represents the identification number of each transect (Route Number).\",\n\t\"license_title\":
